<!DOCTYPE html>
<html lang="tr">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=0.5, maximum-scale=10.0, user-scalable=yes">
    <meta name="mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
    <title>Altcoin Terminal</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, sans-serif;
            background: #0d1117;
            color: #c9d1d9;
            overflow: auto;
            touch-action: auto !important;  /* NATIVE zoom izin ver */
            -webkit-overflow-scrolling: touch;
        }

        /* NATIVE browser zoom iÃ§in */
        .plotly-graph-div,
        .js-plotly-plot,
        .plotly,
        svg.main-svg {
            touch-action: auto !important;  /* Plotly engelini kaldÄ±r */
            pointer-events: auto !important;
        }

        /* Header Bar - HIDDEN on mobile */
        .header {
            background: linear-gradient(135deg, #1a1f2e 0%, #0d1117 100%);
            padding: 8px 15px;
            box-shadow: 0 2px 20px rgba(0,0,0,0.5);
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            z-index: 9999;
            display: none;  /* HIDDEN - buton yok */
            justify-content: space-between;
            align-items: center;
            border-bottom: 1px solid #30363d;
        }

        .header-left {
            display: flex;
            align-items: center;
            gap: 15px;
        }

        .logo {
            font-size: 1.5rem;
            font-weight: bold;
            background: linear-gradient(135deg, #58a6ff, #1f6feb);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }

        .status {
            display: flex;
            align-items: center;
            gap: 8px;
            background: rgba(56, 139, 253, 0.1);
            padding: 6px 12px;
            border-radius: 20px;
            font-size: 0.85rem;
        }

        .status-dot {
            width: 8px;
            height: 8px;
            background: #3fb950;
            border-radius: 50%;
            animation: pulse 2s infinite;
        }

        @keyframes pulse {
            0%, 100% { opacity: 1; transform: scale(1); }
            50% { opacity: 0.6; transform: scale(1.1); }
        }

        .controls {
            display: flex;
            gap: 10px;
        }

        .btn {
            background: linear-gradient(135deg, #238636, #2ea043);
            color: white;
            border: none;
            padding: 8px 16px;
            border-radius: 6px;
            cursor: pointer;
            font-size: 14px;
            font-weight: 500;
            transition: all 0.3s;
            display: flex;
            align-items: center;
            gap: 6px;
        }

        .btn:hover {
            transform: translateY(-2px);
            box-shadow: 0 4px 12px rgba(46, 160, 67, 0.4);
        }

        .btn:active {
            transform: translateY(0);
        }

        .btn-fullscreen {
            background: linear-gradient(135deg, #1f6feb, #388bfd);
        }

        .btn-fullscreen:hover {
            box-shadow: 0 4px 12px rgba(56, 139, 253, 0.4);
        }

        /* Chart Container - FULL SCREEN */
        .chart-container {
            width: 100vw;
            height: 100vh;
            padding: 0;
            background: #0d1117;
            position: fixed;
            top: 0;
            left: 0;
            overflow: hidden;
        }

        #chart {
            width: 100%;
            height: 100%;
            background: #161b22;
            border-radius: 6px;
            box-shadow: 0 4px 20px rgba(0,0,0,0.3);
        }

        /* Plotly container responsive */
        #chart .plotly-graph-div {
            width: 100% !important;
            height: 100% !important;
        }

        #chart .main-svg {
            width: 100% !important;
            height: 100% !important;
        }

        /* Fullscreen Mode */
        .fullscreen-active {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            z-index: 99999;
        }

        .fullscreen-active .header {
            background: rgba(13, 17, 23, 0.95);
            backdrop-filter: blur(10px);
        }

        /* Mobile Optimizations */
        @media (max-width: 768px) {
            .header {
                padding: 8px 10px;
            }

            .logo {
                font-size: 1rem;
            }

            .status {
                font-size: 0.7rem;
                padding: 3px 6px;
            }

            .status-dot {
                width: 6px;
                height: 6px;
            }

            .btn {
                padding: 5px 10px;
                font-size: 11px;
            }

            .header-left {
                gap: 8px;
            }

            .controls {
                gap: 5px;
            }

            .chart-container {
                padding: 2px;
                height: calc(100vh - 45px);
            }

            #chart {
                border-radius: 4px;
            }
        }

        /* Extra small screens */
        @media (max-width: 480px) {
            .logo {
                font-size: 0.9rem;
            }

            .status span {
                display: none;
            }

            .status-dot {
                width: 8px;
                height: 8px;
                margin: 0;
            }

            .btn {
                padding: 4px 8px;
                font-size: 10px;
            }

            .chart-container {
                padding: 1px;
                height: calc(100vh - 40px);
            }
        }

        /* Loading Animation */
        .loading {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            color: #58a6ff;
            font-size: 1.2rem;
            display: none;
        }

        .loading.active {
            display: block;
        }
    </style>
</head>
